import React from 'react';
import { Link } from 'react-router-dom';
import "../sass/index.css";

export default function Logo() {
    return (
        <div>
            <Link className="link" to="/">
                <img className="logo" src="assets/Salinaka.png" alt="logo" />
            </Link>
        </div>
    )
}
